import DonationForm from '../components/DonationForm'
import styled from 'styled-components'

const Styles = styled.div`

    padding: 10rem;
    background-color: ${props => props.theme.lightgrey};

`;

const Donation = props => (
    <Styles>
        <DonationForm />
    </Styles>
);

export default Donation;
